import logo from "../src/Components/Assets/mainlogo.png";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="logo-container">
        <img id="logo" src={logo} alt="HOUND"></img>
      </div>
      <div className="login-form">
        <h2>Login</h2>
      </div>
    </div>
  );
}

export default App;
